import React from "react";
import Dropdown from 'react-bootstrap/Dropdown';
import {Nav, Navbar, NavDropdown} from "react-bootstrap";

export class Navegador extends React.Component {

    render() {
        return(
                <Navbar bg="dark" variant="dark">
                    <div className="container">
                        <div>
                            <Navbar.Brand>
                                <img
                                    alt=""
                                    src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/47/React.svg/1200px-React.svg.png"
                                    width="35"
                                    height="30"
                                    className="d-inline-block align-top"
                                />{' '}
                                MenjaTickets
                            </Navbar.Brand>
                            <Navbar.Toggle aria-controls="basic-navbar-nav" />
                            <Navbar.Collapse id="basic-navbar-nav">
                                <Nav className="mr-auto">
                                    <Nav.Link href={"/Homepage"}>Inici</Nav.Link>
                                    <Nav.Link href={"/"}>Reserves</Nav.Link>

                                    <NavDropdown title={this.props.name} id="basic-nav-dropdown" color={"dark"} drop={"down"}>
                                        <NavDropdown.Item onClick={this.props.onClick}>Tanca sessi√≥</NavDropdown.Item>
                                    </NavDropdown>
                                </Nav>
                            </Navbar.Collapse>
                        </div>
                    </div>
                </Navbar>


        );
    }
}
